import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import Dashboard from "./pages/Dashboard";
import AssignWorkouts from "./pages/AssignWorkouts"; 
import Navbar from "./components/Navbar";
import "./styles/global.css"; 

// Mock Authentication (Replace with real logic)
const isAuthenticated = () => {
  return localStorage.getItem("userToken") !== null; // Example: Check token existence
};

// Protected Route Wrapper
const ProtectedRoute = ({ element }) => {
  return isAuthenticated() ? element : <Navigate to="/" />;
};

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/dashboard" element={<ProtectedRoute element={<Dashboard />} />} />
        <Route path="/assignworkouts" element={<ProtectedRoute element={<AssignWorkouts />} />} />
      </Routes>
    </Router>
  );
}

export default App;
